import React from 'react';
import WeatherCard from './WeatherCard';

const Report = ({ weatherData }) => {

  return (
    <label htmlFor="text">

    <div className="report">
      <div className="card">
        <WeatherCard data={weatherData.daily[0]} />
      </div>
      <div className="card">
        <WeatherCard data={weatherData.daily[1]} />
      </div>
      <div className="card">
        <WeatherCard data={weatherData.daily[2]} />
      </div>
      <div className="card">
        <WeatherCard data={weatherData.daily[3]} />
      </div>
      <div className="card">
        <WeatherCard data={weatherData.daily[4]} />
      </div>
    </div>
    </label>
  );
};

export default Report;
